import React from 'react';
import styled from 'styled-components';

const Wrapper = styled('div')`

`
const Header = styled('div')`
	font-size: 18px;
	color: blue;
`

const Card = () => (
	<Wrapper>
		<Header>Info</Header>
	</Wrapper>
)

export default Card;
